import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <div>
      <h1>Welcome to Holy Family Polymers</h1>
      <p>Your trusted partner in Natural Rubber Latex processing.</p>
      <nav>
        <Link to="/login">Login</Link> | <Link to="/register">Register</Link> | <Link to="/about">About Us</Link> | <Link to="/contact">Contact</Link>
      </nav>
    </div>
  );
};

export default HomePage;
